/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `payroll_summary`(
    IN in_start_date DATE, 
    IN in_end_date DATE, 
    IN in_employee_id INT
)
BEGIN
    SELECT
        p.pay_period_start,
        p.pay_period_end,
        e.employee_id AS employee_number,
        CONCAT(e.last_name, ', ', e.first_name) AS employee_full_name,
        jp.name AS job_position,
        d.name AS department_name,
        p.gross_salary_calc,
        g.sss AS sss_govt_id,
        IFNULL((
            SELECT dct.amount_calc
            FROM Deduction dct
            JOIN Deduction_Rate dr ON dct.deduction_rate_id = dr.deduction_rate_id
            WHERE dct.payroll_id = p.payroll_id AND dr.type = 'SSS'
            LIMIT 1
        ), 0) AS sss_deduction,
        g.philhealth AS philhealth_govt_id,
        IFNULL((
            SELECT dct.amount_calc
            FROM Deduction dct
            JOIN Deduction_Rate dr ON dct.deduction_rate_id = dr.deduction_rate_id
            WHERE dct.payroll_id = p.payroll_id AND dr.type = 'PhilHealth'
            LIMIT 1
        ), 0) AS philhealth_deduction,
        g.pagibig AS pagibig_govt_id,
        IFNULL((
            SELECT dct.amount_calc
            FROM Deduction dct
            JOIN Deduction_Rate dr ON dct.deduction_rate_id = dr.deduction_rate_id
            WHERE dct.payroll_id = p.payroll_id AND dr.type = 'Pag-IBIG'
            LIMIT 1
        ), 0) AS pagibig_contribution,
        g.tin AS tin_govt_id,
        IFNULL((
            SELECT dct.amount_calc
            FROM Deduction dct
            JOIN Deduction_Rate dr ON dct.deduction_rate_id = dr.deduction_rate_id
            WHERE dct.payroll_id = p.payroll_id AND dr.type = 'Withholding Tax'
            LIMIT 1
        ), 0) AS tax_deduction,
        ROUND(
            p.gross_salary_calc
            - IFNULL((
                SELECT SUM(dct.amount_calc)
                FROM Deduction dct
                WHERE dct.payroll_id = p.payroll_id
            ), 0)
            + IFNULL(c.rice_subsidy, 0)
            + IFNULL(c.phone_allowance, 0)
            + IFNULL(c.clothing_allowance, 0)
        , 2) AS net_pay
    FROM
        Payroll p
        JOIN Employee e ON p.employee_id = e.employee_id
        JOIN Job_Position jp ON e.job_position_id = jp.job_position_id
        JOIN Department d ON jp.department_id = d.department_id
        JOIN Government_Id g ON e.gov_id = g.gov_id
        JOIN Compensation c ON e.compensation_id = c.compensation_id
    WHERE
        (in_start_date IS NULL OR p.pay_period_start >= in_start_date)
        AND (in_end_date IS NULL OR p.pay_period_end <= in_end_date)
        AND (in_employee_id IS NULL OR e.employee_id = in_employee_id);
END ;;
