    IN p_phone_allowance DECIMAL(12,2),
    IN p_clothing_allowance DECIMAL(12,2)
)
BEGIN
    -- 1. Insert Address
    INSERT INTO Address (street, barangay, city, province, zipcode)
    VALUES (p_street, p_barangay, p_city, p_province, p_zipcode);
    SET @address_id = LAST_INSERT_ID();

    -- 2. Insert Phone Number (parse area code)
    IF LOCATE('-', p_phone_number) = 0 THEN
        SET @area_code = 0;
        SET @local_number = CAST(p_phone_number AS UNSIGNED);
    ELSE
        SET @raw_area_code = SUBSTRING_INDEX(p_phone_number, '-', 1);
        SET @local_number = CAST(SUBSTRING_INDEX(p_phone_number, '-', -1) AS UNSIGNED);
        IF LENGTH(@raw_area_code) = 0 THEN
            SET @area_code = 0;
        ELSE
            SET @area_code = CAST(@raw_area_code AS UNSIGNED);
        END IF;
    END IF;

    INSERT INTO Phone_Number (area_code, local_number)
    VALUES (@area_code, @local_number);
    SET @phone_id = LAST_INSERT_ID();

    -- 3. Insert Government IDs
    INSERT INTO Government_Id (sss, philhealth, pagibig, tin)
    VALUES (p_sss, p_philhealth, p_pagibig, p_tin);
    SET @gov_id = LAST_INSERT_ID();

    -- 4. Lookup status_id
    SELECT status_id INTO @status_id FROM Status WHERE type = p_status LIMIT 1;

    -- 5. Lookup job_position_id
    SELECT job_position_id INTO @job_position_id FROM Job_Position WHERE name = p_position LIMIT 1;

    -- 6. Find supervisor's employee_id (nullable)
    IF p_supervisor IS NOT NULL AND p_supervisor <> '' THEN
        SELECT employee_id INTO @supervisor_id
        FROM Employee
        WHERE CONCAT(first_name, ' ', last_name) = p_supervisor
        LIMIT 1;
    ELSE
        SET @supervisor_id = NULL;
    END IF;

    -- 7. Insert Compensation (new structure)
    INSERT INTO Compensation (basic_salary, rice_subsidy, phone_allowance, clothing_allowance)
    VALUES (p_basic_salary, p_rice_subsidy, p_phone_allowance, p_clothing_allowance);
    SET @compensation_id = LAST_INSERT_ID();

    -- 8. Insert Employee (now with compensation_id)
    INSERT INTO Employee (
        last_name, first_name, birthdate,
        address_id, phone_id, gov_id,
        status_id, job_position_id, compensation_id, supervisor_id
    ) VALUES (
        p_last_name, p_first_name, p_birthdate,
        @address_id, @phone_id, @gov_id,
        @status_id, @job_position_id, @compensation_id, @supervisor_id
    );

    SET @employee_id = LAST_INSERT_ID();

    -- Optionally, return the new employee_id
    SELECT @employee_id AS new_employee_id;
END ;;
DELIMITER ;
