CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_attendance`(
    IN in_employee_id INT,
    IN in_start_date DATE,
    IN in_end_date DATE
)
BEGIN
    SELECT
        a.attendance_id,
        a.employee_id,
        a.date,
        a.time_in,
        a.time_out,
        a.regular_hours_calc,
        o.otrate AS overtime_rate,
        o.overtime_hours_calc AS overtime_hours_calc,
        o.updated_date AS overtime_updated_date,
        e.last_name,
        e.first_name,
        o.approver_id AS overtime_approver_id,
        eo.last_name AS overtime_approver_last_name,
        eo.first_name AS overtime_approver_first_name
    FROM
        attendance a
    JOIN
        employee e ON a.employee_id = e.employee_id
    LEFT JOIN
        overtime o ON a.attendance_id = o.attendance_id
    LEFT JOIN
        employee eo ON o.approver_id = eo.employee_id
    WHERE
        (in_employee_id IS NULL OR a.employee_id = in_employee_id)
        AND (in_start_date IS NULL OR a.date >= in_start_date)
        AND (in_end_date IS NULL OR a.date <= in_end_date);
END ;;
DELIMITER ;
