CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_delete_employee`(IN emp_id INT)
BEGIN
    -- 1. Set supervisor_id to NULL for all subordinates of this employee
    UPDATE Employee
    SET supervisor_id = NULL
    WHERE supervisor_id = emp_id;

    -- 2. Update the employee's status to '11 Inactive'
    UPDATE Employee
    SET status_id = 11
    WHERE employee_id = emp_id;
    
	-- 3. Block employee from access system
    UPDATE Login
    SET no_attempt = '3'
    WHERE employee_id = emp_id;
END ;;
DELIMITER ;
