CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_employee_details`(IN emp_id INT)
BEGIN
    SELECT
        e.employee_id,
        e.last_name,
        e.first_name,
        e.birthdate,

        -- Address fields
        a.street,
        a.barangay,
        a.city,
        a.province,
        a.zipcode,

        -- Phone number (concatenated)
        CONCAT(ac.area_code, '-', pn.local_number) AS phone_number,

        -- Government IDs
        g.sss,
        g.philhealth,
        g.pagibig,
        g.tin,

        -- Status
        s.type AS employment_status,

        -- Job position
        jp.name AS job_position,

        -- Immediate Supervisor (using self-referencing FK)
        CONCAT(sup.first_name, ' ', sup.last_name) AS immediate_supervisor,

        -- Compensation fields (Basic Salary & Allowances)
        c.basic_salary,
        c.rice_subsidy,
        c.phone_allowance,
        c.clothing_allowance

    FROM Employee e
        LEFT JOIN Employee sup ON e.supervisor_id = sup.employee_id
        JOIN Address a ON e.address_id = a.address_id
        JOIN Phone_Number pn ON e.phone_id = pn.phone_id
        JOIN Area_code ac ON pn.area_code = ac.area_code
        JOIN Government_Id g ON e.gov_id = g.gov_id
        JOIN Status s ON e.status_id = s.status_id
        JOIN Job_Position jp ON e.job_position_id = jp.job_position_id
        JOIN Compensation c ON c.compensation_id = e.compensation_id
    WHERE (emp_id IS NULL OR e.employee_id = emp_id)
      AND s.status_id <> 11   -- Exclude inactive employees
    ORDER BY e.employee_id;
END ;;
DELIMITER ;
