CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_leave_request`(
  IN p_employee_id INT,
  IN p_status VARCHAR(20)
)
BEGIN
  SELECT
    lr.leave_id            AS entry_id,
    lr.employee_id,
    e.last_name,
    e.first_name,
    lr.status              AS leave_status,
    lr.request_date,
    lt.name                AS leave_type,
    lr.reason,
    lr.start_date,
    lr.end_date,
    lr.calc_leave,
    CONCAT(a.first_name, ' ', a.last_name) AS approver,
    lr.last_update         AS approved_date
  FROM Leave_Request lr
  JOIN Employee e ON lr.employee_id = e.employee_id
  JOIN Leave_Type lt ON lr.leave_type_id = lt.leave_type_id
  LEFT JOIN Approver ap ON lr.approver_id = ap.approver_id
  LEFT JOIN Employee a ON ap.employee_id = a.employee_id
  WHERE
    (p_employee_id IS NULL OR lr.employee_id = p_employee_id)
    AND (p_status IS NULL OR p_status = '' OR lr.status = p_status)
  ORDER BY lr.leave_id ASC;
END ;;
