CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_leave_update`(
  IN p_leave_id        INT,
  IN p_status          VARCHAR(20),
   IN p_employee_id     INT,         -- This is the approver's employee_id
  IN p_approved_date   TIMESTAMP
)
BEGIN
  DECLARE v_approver_id INT;

  -- Find approver_id in Approver table using employee_id
  SELECT approver_id INTO v_approver_id
  FROM Approver
  WHERE employee_id = p_employee_id
  LIMIT 1;

  IF v_approver_id IS NULL THEN
    SIGNAL SQLSTATE '45000'
      SET MESSAGE_TEXT = 'No approver_id found for the given employee_id.';
  ELSE
    UPDATE Leave_Request
    SET
      status       = COALESCE(p_status, status),
    
      approver_id  = v_approver_id,   -- Store approver PK here!
      last_update  = COALESCE(p_approved_date, last_update)
    WHERE leave_id = p_leave_id;
  END IF;
END ;;
DELIMITER ;
