CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_payslip`(
    IN in_employee_id INT,
    IN in_pay_period_start DATE,
    IN in_pay_period_end DATE
)
BEGIN
    SELECT
        p.employee_id,
        CONCAT(e.last_name, ', ', e.first_name) AS employee_full_name,
        jp.name AS job_position,
        d.name AS department_name,
        p.pay_period_start,
        p.pay_period_end,
        c.basic_salary,

        -- Daily rate calculation
        ROUND(
            c.basic_salary /
            (
                SELECT MAX(days_count)
                FROM (
                    SELECT COUNT(*) AS days_count
                    FROM Attendance a2
                    WHERE MONTH(a2.date) = MONTH(p.pay_period_start)
                      AND YEAR(a2.date) = YEAR(p.pay_period_start)
                    GROUP BY a2.employee_id
                ) AS sub
            ),
        2) AS daily_rate,

        IFNULL((
            SELECT SUM(a.regular_hours_calc)
            FROM Attendance a
            WHERE a.employee_id = p.employee_id
              AND a.date BETWEEN p.pay_period_start AND p.pay_period_end
        ), 0) AS total_worked_hours,

        IFNULL((
            SELECT SUM(o.overtime_hours_calc)
            FROM Overtime o
            JOIN Attendance a ON o.attendance_id = a.attendance_id
            WHERE a.employee_id = p.employee_id
              AND a.date BETWEEN p.pay_period_start AND p.pay_period_end
        ), 0) AS overtime_hours,

        (
            SELECT COUNT(*) 
            FROM Attendance a
            WHERE a.employee_id = p.employee_id
              AND a.date BETWEEN p.pay_period_start AND p.pay_period_end
        ) AS days_worked,

        p.gross_salary_calc,
        c.rice_subsidy,
        c.phone_allowance,
        c.clothing_allowance,
        (c.rice_subsidy + c.phone_allowance + c.clothing_allowance) AS total_benefits,

        IFNULL((
            SELECT d.amount_calc
            FROM Deduction d
            JOIN Deduction_Rate dr ON d.deduction_rate_id = dr.deduction_rate_id
            WHERE d.payroll_id = p.payroll_id AND dr.type = 'SSS'
            LIMIT 1
        ), 0) AS sss_deduction,

        IFNULL((
            SELECT d.amount_calc
            FROM Deduction d
            JOIN Deduction_Rate dr ON d.deduction_rate_id = dr.deduction_rate_id
            WHERE d.payroll_id = p.payroll_id AND dr.type = 'PhilHealth'
            LIMIT 1
        ), 0) AS philhealth,

        IFNULL((
            SELECT d.amount_calc
            FROM Deduction d
            JOIN Deduction_Rate dr ON d.deduction_rate_id = dr.deduction_rate_id
            WHERE d.payroll_id = p.payroll_id AND dr.type = 'Pag-IBIG'
            LIMIT 1
        ), 0) AS pagibig,

        (
            p.gross_salary_calc
            - IFNULL((
                SELECT d.amount_calc FROM Deduction d
                JOIN Deduction_Rate dr ON d.deduction_rate_id = dr.deduction_rate_id
                WHERE d.payroll_id = p.payroll_id AND dr.type = 'SSS'
                LIMIT 1), 0)
            - IFNULL((
                SELECT d.amount_calc FROM Deduction d
                JOIN Deduction_Rate dr ON d.deduction_rate_id = dr.deduction_rate_id
                WHERE d.payroll_id = p.payroll_id AND dr.type = 'PhilHealth'
                LIMIT 1), 0)
            - IFNULL((
                SELECT d.amount_calc FROM Deduction d
                JOIN Deduction_Rate dr ON d.deduction_rate_id = dr.deduction_rate_id
                WHERE d.payroll_id = p.payroll_id AND dr.type = 'Pag-IBIG'
                LIMIT 1), 0)
        ) AS taxable_income,

        IFNULL((
            SELECT d.amount_calc
            FROM Deduction d
            JOIN Deduction_Rate dr ON d.deduction_rate_id = dr.deduction_rate_id
            WHERE d.payroll_id = p.payroll_id AND dr.type = 'Withholding Tax'
            LIMIT 1
        ), 0) AS withholding_tax,

        (
            IFNULL((
                SELECT d.amount_calc
                FROM Deduction d
                JOIN Deduction_Rate dr ON d.deduction_rate_id = dr.deduction_rate_id
                WHERE d.payroll_id = p.payroll_id AND dr.type = 'SSS'
                LIMIT 1
            ), 0)
            +
            IFNULL((
                SELECT d.amount_calc
                FROM Deduction d
                JOIN Deduction_Rate dr ON d.deduction_rate_id = dr.deduction_rate_id
                WHERE d.payroll_id = p.payroll_id AND dr.type = 'PhilHealth'
                LIMIT 1
            ), 0)
            +
            IFNULL((
                SELECT d.amount_calc
                FROM Deduction d
                JOIN Deduction_Rate dr ON d.deduction_rate_id = dr.deduction_rate_id
                WHERE d.payroll_id = p.payroll_id AND dr.type = 'Pag-IBIG'
                LIMIT 1
            ), 0)
            +
            IFNULL((
                SELECT d.amount_calc
                FROM Deduction d
                JOIN Deduction_Rate dr ON d.deduction_rate_id = dr.deduction_rate_id
                WHERE d.payroll_id = p.payroll_id AND dr.type = 'Withholding Tax'
                LIMIT 1
            ), 0)
        ) AS total_deductions,

        ROUND(
            p.gross_salary_calc
            - (
                IFNULL((
                    SELECT d.amount_calc
                    FROM Deduction d
                    JOIN Deduction_Rate dr ON d.deduction_rate_id = dr.deduction_rate_id
                    WHERE d.payroll_id = p.payroll_id AND dr.type = 'SSS'
                    LIMIT 1
                ), 0)
                +
                IFNULL((
                    SELECT d.amount_calc
                    FROM Deduction d
                    JOIN Deduction_Rate dr ON d.deduction_rate_id = dr.deduction_rate_id
                    WHERE d.payroll_id = p.payroll_id AND dr.type = 'PhilHealth'
                    LIMIT 1
                ), 0)
                +
                IFNULL((
                    SELECT d.amount_calc
                    FROM Deduction d
                    JOIN Deduction_Rate dr ON d.deduction_rate_id = dr.deduction_rate_id
                    WHERE d.payroll_id = p.payroll_id AND dr.type = 'Pag-IBIG'
                    LIMIT 1
                ), 0)
                +
                IFNULL((
                    SELECT d.amount_calc
                    FROM Deduction d
                    JOIN Deduction_Rate dr ON d.deduction_rate_id = dr.deduction_rate_id
                    WHERE d.payroll_id = p.payroll_id AND dr.type = 'Withholding Tax'
                    LIMIT 1
                ), 0)
            )
            + (c.rice_subsidy + c.phone_allowance + c.clothing_allowance)
        , 2) AS takehome_pay

    FROM
        Payroll p
    JOIN Employee e ON p.employee_id = e.employee_id
    JOIN Job_Position jp ON e.job_position_id = jp.job_position_id
    JOIN Department d ON jp.department_id = d.department_id
    JOIN Compensation c ON e.compensation_id = c.compensation_id

    WHERE
        (p.employee_id = in_employee_id OR in_employee_id IS NULL)
        AND (p.pay_period_start = in_pay_period_start OR in_pay_period_start IS NULL)
        AND (p.pay_period_end = in_pay_period_end OR in_pay_period_end IS NULL);

END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `sp_update_attendance` */;
