CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_update_attendance`(
    IN in_attendance_id INT,
    IN in_time_in TIME,
    IN in_time_out TIME,
    IN in_regular_hours_calc DECIMAL(5,2),
    IN in_otrate DECIMAL(5,2),
    IN in_overtime_hours_calc DECIMAL(5,2),
    IN in_overtime_updated_date DATE,
    IN in_employee_id INT -- use employee_id instead of approver_id
)
BEGIN
    DECLARE approverId INT;

    -- Only look up approver if employee_id is not null
    IF in_employee_id IS NOT NULL THEN
        SELECT approver_id INTO approverId
        FROM approver
        WHERE employee_id = in_employee_id
        LIMIT 1;
    ELSE
        SET approverId = NULL;
    END IF;

    -- Update attendance table
    UPDATE attendance
    SET
        time_in = IFNULL(in_time_in, time_in),
        time_out = IFNULL(in_time_out, time_out),
        regular_hours_calc = IFNULL(in_regular_hours_calc, regular_hours_calc)
    WHERE attendance_id = in_attendance_id;

    -- Update overtime table, now setting approver_id to NULL if approverId is NULL
    UPDATE overtime
    SET
        otrate = IFNULL(in_otrate, otrate),
        overtime_hours_calc = IFNULL(in_overtime_hours_calc, overtime_hours_calc),
        updated_date = IFNULL(in_overtime_updated_date, updated_date),
        approver_id = approverId
    WHERE attendance_id = in_attendance_id;
END ;;
DELIMITER ;
