CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_update_employee`(
    IN p_employee_id INT,
    IN p_last_name VARCHAR(100),
    IN p_first_name VARCHAR(100),
    IN p_birthdate DATE,
    IN p_street VARCHAR(100),
    IN p_barangay VARCHAR(100),
    IN p_city VARCHAR(100),
    IN p_province VARCHAR(100),
    IN p_zipcode INT(6),
    IN p_phone_number VARCHAR(100),
    IN p_sss VARCHAR(20),
    IN p_philhealth VARCHAR(20),
    IN p_pagibig VARCHAR(20),
    IN p_tin VARCHAR(20),
    IN p_status VARCHAR(500),
    IN p_position VARCHAR(100),
    IN p_supervisor VARCHAR(100),
    IN p_basic_salary DECIMAL(12,2),
    IN p_rice_subsidy DECIMAL(12,2),
    IN p_phone_allowance DECIMAL(12,2),
    IN p_clothing_allowance DECIMAL(12,2)
)
BEGIN
    -- 1. Get related IDs from Employee table
    SELECT 
        address_id, 
        phone_id, 
        gov_id, 
        compensation_id
    INTO 
        @address_id, 
        @phone_id, 
        @gov_id, 
        @compensation_id
    FROM Employee
    WHERE employee_id = p_employee_id;

    -- 2. Update Address info
    UPDATE Address
       SET street    = p_street,
           barangay  = p_barangay,
           city      = p_city,
           province  = p_province,
           zipcode   = p_zipcode
     WHERE address_id = @address_id;

    -- 3. Parse phone number (for area code and local number)
    IF LOCATE('-', p_phone_number) = 0 THEN
        SET @area_code = 0;
        SET @local_number = CAST(p_phone_number AS UNSIGNED);
    ELSE
        SET @raw_area_code = SUBSTRING_INDEX(p_phone_number, '-', 1);
        SET @local_number = CAST(SUBSTRING_INDEX(p_phone_number, '-', -1) AS UNSIGNED);
        IF LENGTH(@raw_area_code) = 0 THEN
            SET @area_code = 0;
        ELSE
            SET @area_code = CAST(@raw_area_code AS UNSIGNED);
        END IF;
    END IF;

    -- 4. Update Phone Number
    UPDATE Phone_Number
       SET area_code   = @area_code,
           local_number = @local_number
     WHERE phone_id = @phone_id;

    -- 5. Update Government_Id
    UPDATE Government_Id
       SET sss        = p_sss,
           philhealth = p_philhealth,
           pagibig    = p_pagibig,
           tin        = p_tin
     WHERE gov_id = @gov_id;

    -- 6. Lookup status_id
    SELECT status_id 
      INTO @new_status_id
      FROM Status
     WHERE type = p_status
     LIMIT 1;

    -- 7. Lookup job_position_id
    SELECT job_position_id 
      INTO @new_job_position_id
      FROM Job_Position
     WHERE name = p_position
     LIMIT 1;

    -- 8. Find supervisor's employee_id (nullable)
    IF p_supervisor IS NOT NULL AND p_supervisor <> '' THEN
        SELECT employee_id
          INTO @new_supervisor_id
          FROM Employee
         WHERE CONCAT(first_name, ' ', last_name) = p_supervisor
         LIMIT 1;
    ELSE
        SET @new_supervisor_id = NULL;
    END IF;

    -- 9. Update Compensation
    UPDATE Compensation
       SET basic_salary      = p_basic_salary,
           rice_subsidy     = p_rice_subsidy,
           phone_allowance  = p_phone_allowance,
           clothing_allowance = p_clothing_allowance
     WHERE compensation_id = @compensation_id;

    -- 10. Update Employee record
    UPDATE Employee
       SET last_name      = p_last_name,
           first_name     = p_first_name,
           birthdate      = p_birthdate,
           status_id      = @new_status_id,
           job_position_id = @new_job_position_id,
           supervisor_id  = @new_supervisor_id
     WHERE employee_id = p_employee_id;

END ;;
